import React from 'react';
import {Swiper, SwiperSlide} from 'swiper/react';
import SwiperCore, {Pagination} from 'swiper';
import 'swiper/swiper-bundle.css';
import './PharmacySlider1.css';

SwiperCore.use([Pagination]);

function PharmacySlider1() {

    return (
        <div>
          <Swiper pagination={{clickable:true}} loop className="pharmacySlider1-container">
              <SwiperSlide>
                    <div className="pharmacySlide1">Slide 1</div>
              </SwiperSlide>
              <SwiperSlide>
                    <div className="pharmacySlide1">Slide 2</div>
              </SwiperSlide>
              <SwiperSlide>
                    <div className="pharmacySlide1">Slide 3</div>
              </SwiperSlide>
              <SwiperSlide>
                  <div className="pharmacySlide1">Slide 4</div>
              </SwiperSlide>
          </Swiper>  
        </div>
    )
}

export default PharmacySlider1;
